description.narrative:
The role of the Program Development and Resources Mobilisation (PDRM) working group is to facilitate effective program design, stakeholder engagement, business development and resource mobilization in order to support the development of Youth Active Citizenship programs for Oxfam. PDRM Objectives:

1. Program Proposals are developed through participatory processes that includes young active citizens, country office staff and other relevant stakeholders;
2. Funding is secured to support Youth Active Citizenship Programs atthe Country, multi country, regional and global levels in a manner that supports Oxfam to achieve its programming goals;
3. Oxfam staff engage with donors and stakeholders in a strategic manner that secures the funding for YAC programming that supports Oxfam to achieve its programming goals.
